import React from "react";
import { useState } from "react";
import FilledStar from "./FilledStar";
import NotFilledStar from "./NotFilledStar";
import '../styles/Swan.scss'

function Swan({data, chosen, setChosen, id_}){


    const [featured, setFeatured] = useState(data['feat'])
    const [process, setProcess] = useState(data['process'])
    const [date, setDate] = useState(data['date'])
    const [title, setTitle] = useState(data['title'])
    const [total, setTotal] = useState(data['total'])
    const [ship, setShip] = useState(data['ship'])
    const [klik, setKlik] = useState(data['klik'])
    const [small, setSmall] = useState(data['small'])

    return <div className={"swan " + (chosen ? 'chosen' : '')} onClick={()=>{setChosen(id_)}}>
    <div className="swanTop">
      <div className="swanLeft">
        <div className="name">{title}</div>
        {process === 0 ? <div className="process"><p className="processText">Распознано</p><img src="Icons/Ok.svg"/></div>
        : (process === 1 ? <div className="process"><p className="processText">Частично</p><img src="Icons/Normal.svg"/></div>
        : <div className="process"><p className="processText">Не распознано</p><img src="Icons/Not.svg"/></div>)}
        <div className="date">{date}</div>
      </div>
      <div className="swanRight">
        <div className="star" onClick={()=>{setFeatured(!featured)}}>
            {featured ? <FilledStar/> : <NotFilledStar/>}
        </div>
        <div className="bin">
            <img src='Icons/trash.svg'/>
        </div>
      </div>
    </div>
    <div className="swanBottom">
      <div className="swanInfo">Лебеди: {total}</div>
      <div className="swanInfo">Шипуны: {ship}</div>
      <div className="swanInfo">Кликуны: {klik}</div>
      <div className="swanInfo">Малые: {small}</div>
      <div className="swanInfo">Нераспознанные: {total-ship-klik-small}</div>
    </div>
  </div>
}

export default Swan;
